import {ScreenshotOptions}                      from "../../driver/interface/Browser";
import {parseBrowserVersion, processScreenshot} from "../../driver/lib/client/client_utils";

describe(`Using the client utils`, (): void => {

    describe(`to format the browser version`, (): void => {
        it(`should return 0 for all version parts 
        - (test case id: 87e320d9-e95f-41a8-ae8e-d89c94f0cb0b)`, (): void => {
            const expected = {
                major: 0,
                minor: 0,
                patch: 0
            };

            expect(parseBrowserVersion()).toEqual(expected);
            expect(parseBrowserVersion(``)).toEqual(expected);
        });

        it(`should return 0 for all version parts when only the version separator is passed 
        - (test case id: f79e11f7-a632-4d87-8e00-b6ddd859755c)`, (): void => {
            const expected = {
                major: 0,
                minor: 0,
                patch: 0
            };

            expect(parseBrowserVersion(`....`)).toEqual(expected);
        });

        it(`should return the major version 
        - (test case id: 5219763e-0ac4-4fda-85b4-36a93e817365)`, (): void => {
            const expected = {
                major: 123,
                minor: 0,
                patch: 0
            };

            expect(parseBrowserVersion(`123`)).toEqual(expected);
        });

        it(`should return the minor version 
        - (test case id: f86d9726-f3e4-40fe-8c4a-ea235a4965f6)`, (): void => {
            const expected = {
                major: 123,
                minor: 456,
                patch: 0
            };

            expect(parseBrowserVersion(`123.456`)).toEqual(expected);
        });

        it(`should return the minor version 
        - (test case id: 9ff55b75-7646-4e7c-a8d0-ddc6da1532c5)`, (): void => {
            const expected = {
                major: 123,
                minor: 456,
                patch: 789
            };

            expect(parseBrowserVersion(`123.456.789`)).toEqual(expected);
        });
    });

    describe(`to process an image`, (): void => {

        const image = ``;
        const image20x20 = ``;

        it(`should return that image if no size is given 
        - (test case id: 382164c7-7955-47b9-8f32-5186eef472a6)`, async (): Promise<void> => {
            const image = `iVBORw0KGgoAAAANSUhEUgAAAQAAAAEACAYAAABccqhmAAAACXBIWXMAAA7EAAAOxAGVKw4bAAAgAElEQVR4nO2de2zcV5XHP4xGlmVZxvJ6s8GKIitbslXIpiGEEkJbun3RVwINpS3pm4aWPkIJVXlst6Cq2y0lWwoqpQ9KH7SFPumTUEoofaYlpNmQDSFbheCNoigbRcZrRV7Lsib7x3d`;

            const processedImage = await processScreenshot()(image);

            expect(processedImage).toEqual(image);
        });

        it(`should return that image if both dimensions are given
        - (test case id: 31dad223-c4f9-457d-852c-bcb8b9f54039)`, async (): Promise<void> => {

            const opts: ScreenshotOptions = {
                size: {
                    width: 20,
                    height: 20
                }
            };

            const processedImage = await processScreenshot(opts)(image);
            expect(processedImage).toEqual(image20x20);
        });

        it(`should return that image if only width dimensions is given 
        - (test case id: c975964a-8d8f-4aee-83dd-f3596a26b2e1)`, async (): Promise<void> => {

            const opts: ScreenshotOptions = {
                size: {
                    width: 20}
            };

            const processedImage = await processScreenshot(opts)(image);
            expect(processedImage).toEqual(image20x20);
        });

        it(`should return that image if only height dimensions is given  
        - (test case id: 109a774f-d802-4e65-8ba7-a534347357ea)`, async (): Promise<void> => {

            const opts: ScreenshotOptions = {
                size: {
                    height: 20}
            };

            const processedImage = await processScreenshot(opts)(image);
            expect(processedImage).toEqual(image20x20);
        });
    });
});